import { Box, Typography } from '@mui/material';
import TextField from '@mui/material';

const Payment = ({ values, handleBlur, touched, error, handleChange }) => {
    return (
        <Box m='30px 0'>
            {/* CONTACT INFO */}
            <Box>
                <Typography mb='15px' fontSize='18px'> Contact Info</Typography>
                <TextField
        fullWidth
        type="text"
        label="Zip Code"
        onBlur={handleBlur}
        onChange={handleChange}
        value={values.zipCode}
        name={formattedName('zipCode')}
        error={formattedError('zipCode')}
        helperText={formattedHelper('zipCode')}
        sx={{ gridColumn: '1fr' }}
      />
            </Box>

        </Box>
    )
};

export default Payment;
